import React from "react";


const Faq=()=>{
  const Questions=[
    {
        id:1,title:'hello world',
        Content:'here are the best thing in this world i am the one guy on this planet '
    },
    {
        id:2,title:'hello world title 2',Content:'i am the best in this world i have the knowldedge'
    },{
        id:3,
        title:'hello',
        Content:'j hos ramro garna lagis khusi lagyo '
    }
  ]

    return(
        <div>
         {
            Questions.map((question)=><li key={question.id}>
            {Question.title}
            </li>)
         }
        </div>
    )
}
export default Faq;
